import React from "react"
import InfoBlock from "./InfoBlock"
import "../assets/css/body.css"
import plane from "../assets/imgs/plane.svg"

class Body extends React.Component{
    render(){
        return(
            <div className="other">
                <InfoBlock />
                <img src={plane} />
            </div>
        )
    }
}

export default Body
